import React from 'react';
const ColorSelector = () => {
  return (
    <table>
      <tbody>
        <tr>
          {this.state.colors.map((color, index) => (
            <td
              key={index}
              style={{ backgroundColor: color, width: '5px', height: '5px' }}
            >
              {color}
            </td>
          ))}
          <td></td>
        </tr>
      </tbody>
    </table>
  );
};

export default ColorSelector;
